import React, { version } from 'react';
import {View, Text, StyleSheet} from 'react-native';

export default function Pontos (){
    return (
        <View>
            <Text> Tela de Pontos de coleta </Text>
        </View>
        
    );
}

const styles = StyleSheet.create({
    container: {
        flex:1,
        justifyContent:'center',
        alignItems: 'center'
    }
});
